import React from "react";
import Record from "./Record";

function RecordList({records}){

    return(
        <div className="App">
        <table>
          <tr>
            <th>Exercise</th>
            <th>Metric</th>
            <th>Date</th>
          </tr>
          {records.map(record => (
                <Record 
                    key={record.id}
                    record={record}
                />
            ))}
        </table>
      </div>
    )
}

export default RecordList;
